import React, { useState, useEffect } from 'react';
import './App.css'; // Import your CSS file for styling
import VideoParallax from './VideoParallax';
import ScrollyVideo from 'scrolly-video/dist/ScrollyVideo.cjs.jsx';

function App() {
  const [firstPartEnded, setFirstPartEnded] = useState(false);
  const [roomCode, setRoomCode] = useState('');
  const [showRulesPopup, setShowRulesPopup] = useState(false); // State to control the visibility of the rules popup

  const handleFirstPartEnded = () => {
    setFirstPartEnded(true); // Set firstPartEnded to true when the first part of the video ends
  };

  const handleInputChange = (event) => {
    setRoomCode(event.target.value);
  };

  const handleSubmit = () => {
    if (roomCode.trim() !== '') {
      // Redirect to the URL with the room code
      window.location.href = `https://limericksmash.com/games/${roomCode}`;
    }
  };

  console.log('Rendering with firstPartEnded:', firstPartEnded);

  return (
    <div className="App">
      <div style={{height:"900vh"}}> 

      <ScrollyVideo 
      frameThreshold ={0.2}
      videoPercentage = {.6}
      trackscroll cover sticky src="/parallax/sequence 01.mp4" />
      </div>

      {/* {!firstPartEnded ? (
          <div>
              <video className="parallax-video" autoPlay muted style={{width: "100%", height:"100vh", zIndex:"2"}}>
              <source src="/parallax/layer3.webm" type="video/webm" />
            </video>
            <video className="parallax-video" autoPlay muted style={{width: "100%", height:"100vh", zIndex:"2"}}>
              <source src="/parallax/layer2.webm" type="video/webm" />
            </video>
            <video className="parallax-video" onEnded={handleFirstPartEnded} autoPlay muted style={{width: "100%", height:"100vh", zIndex:"1"}}>
              <source src="/parallax/final impact_1.webm" type="video/webm" />
            </video>
            </div>
        ) : (
          <div>
            bleh
            </div>
          // <video style={{ opacity: "70%", transition: "opacity 2s ease-in" }} autoPlay loop>
          //   <source src="/bouncable.mp4" type="video/mp4" />
          //   Your browser does not support the video tag.
          // </video>
        )} */}
      {/* <video className="parallax-video" autoPlay loop muted style={{width: "100%", height:"100vh", zIndex:"2"}}>
          <source src="/parallax/layer3.webm" type="video/webm" />
        </video>
        <video className="parallax-video" autoPlay loop muted style={{width: "100%", height:"100vh", zIndex:"2"}}>
          <source src="/parallax/layer2.webm" type="video/webm" />
        </video>
        <video className="parallax-video" onEnded={handleFirstPartEnded} autoPlay loop muted style={{width: "100%", height:"100vh", zIndex:"2"}}>
          <source src="/parallax/final impact_1.webm" type="video/webm" />
        </video>
      <VideoParallax /> */}
      <div className="fullscreen-video-container">

        {/* {!firstPartEnded ? (
          // <video autoPlay muted onEnded={handleFirstPartEnded}>
          //   <source src="/limericksmash5.mp4" type="video/mp4" />
          //   Your browser does not support the video tag.
          // </video>
        ) : (
          // <video style={{ opacity: "70%", transition: "opacity 2s ease-in" }} autoPlay loop>
          //   <source src="/bouncable.mp4" type="video/mp4" />
          //   Your browser does not support the video tag.
          // </video>
        )} */}
      </div>



      <div className={`content ${firstPartEnded ? 'content-visible' : 'content-hidden'} `}>
        <button className="rules-button" onClick={() =>  {setShowRulesPopup(!showRulesPopup)}}>
          <img style={{ width: "20px", fill: "#FFFFFF" }} src="/lightbulg.svg" alt="Lightbulb Icon" />
        </button>

            {/* Rules popup */}
          <div className={`rules-popup ${showRulesPopup ? 'show' : ''}`}>
              <div className = "popuptext">
            <button style={{width:"30px", height:"30px", position: 'absolute', right: "20px", top:"20px"}}onClick={() => {
                  setShowRulesPopup(false)
                }}>
                  <img src="/close-circle-svgrepo-com 1.svg" />
                </button>
              <div className="rules-content">
                <h2>What's a Limerick?</h2>
                <p>A limerick is a five-line poem with a distinctive rhythm and rhyme scheme. It usually has a humorous or nonsensical theme. </p>
                <p>The rhyme scheme is typically AABBA.</p>
                <p>
                <span className="indented lineATitle">A:</span> <span className="lineA">  Welcome to a game most fine</span>
                </p>
                <p>
                <span className="indented lineATitle">A:</span> <span className="lineA">   Where each round we write one more line</span>
                </p>
                <p>
                <span className="indented lineBTitle">B:</span> <span className="lineB"> With each line we compete</span>
                </p>
                <p> 
                <span className="indented lineBTitle">B:</span> <span className=" lineB">  Till the limerick's complete</span>
                </p>
                <p>
                <span className="indented lineATitle">A:</span> <span className=" lineA"> And in legend the winner's enshrined!</span >
                </p>

                <p>The structure often follows anapestic meter, with the first, second, and fifth lines having three stressed syllables and the third and fourth lines having two stressed syllables.</p>
                </div>
            </div>
          </div>

        <div className={`centerContent ${showRulesPopup ? 'centerContent-hidden' : ''}`}>
          <h1>LIMERICK SMASH</h1>
          <div className="input-container">
            <input
              type="text"
              placeholder="Enter room code"
              value={roomCode}
              onChange={handleInputChange}
            />
            <button onClick={handleSubmit}>Create or Join Room</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
